import './App.css';
import YogaForm from './components/YogaForm';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import  YogaInsert from './pages/YogaInsert'
import YogaUpdate from "./pages/YogaUpdate"

function App() {
  return (
    <Router>
    <header>
      Yoga Class Admission From
    </header>
      <YogaForm/>
      <Routes>
                <Route path="/yoga/create" exact component={YogaInsert} />
                <Route
                    path="/yoga/update/:id"
                    exact
                    component={YogaUpdate}
                />
                </Routes>
      </Router>
  );
}

export default App;
